description:
Verenigd Koninkrijk
Komedie
94 minuten

goed

met Riz Ahmed, Nigel Lindsay en Kayvan Novak

In een Britse stad hebben vier mannen een geheim plan. Omar (Riz Ahmed) is verontwaardigd over de manier waarop moslims in de 
wereld worden behandeld en is daarom vastbesloten om een jihadstrijder te worden. Zijn niet al te slimme vriend Waj is meteen 
verkocht. Omars andere vrienden, de blanke Barry en Faisel doen ook mee. Faisal kan een bom maken, maar zichzelf nog niet 
opblazen vanwege zijn zieke vader. Ook al zijn ze niet de slimsten, ze proberen toch op hun eigen manier de stad een klap toe 
te brengen.
